/*******************************************************************
*
*       _DemoScale
*/
static void _DemoScale(unsigned int *angle) {
  GUI_AUTODEV AutoDevCh1,AutoDevCh2,AutoDevCh3,AutoDevCh4,AutoDevNumText;    // Object for banding memory device
  PARAM       ParamCh1,ParamCh2,ParamCh3,ParamCh4,ParamNumtext;      // Parameters for drawing routine
  //
  // Enable high resolution for antialiasing
  //
  GUI_AA_EnableHiRes();
  GUI_AA_SetFactor(MAG);
  
  GUI_MEMDEV_CreateAuto(&AutoDevCh1);
	GUI_MEMDEV_CreateAuto(&AutoDevCh2);
	GUI_MEMDEV_CreateAuto(&AutoDevCh3);
	GUI_MEMDEV_CreateAuto(&AutoDevCh4);
	GUI_MEMDEV_CreateAuto(&AutoDevNumText);
    //
    // Show needle for a fixed time
    //
	  ParamCh1.Angle =	*(angle)	* DEG2RAD;
	  ParamCh2.Angle =	*(angle+1)	* DEG2RAD;
	  ParamCh3.Angle =	*(angle+2)	* DEG2RAD;
	  ParamCh4.Angle =	*(angle+3)	* DEG2RAD;
    GUI_RotatePolygon(ParamCh1.aPoints, _aNeedle, countof(_aNeedle), ParamCh1.Angle);
    GUI_MEMDEV_DrawAuto(&AutoDevCh1, &ParamCh1.AutoDevInfo, &_DrawCh1, &ParamCh1);
	  GUI_RotatePolygon(ParamCh2.aPoints, _aNeedle, countof(_aNeedle), ParamCh2.Angle);
    GUI_MEMDEV_DrawAuto(&AutoDevCh2, &ParamCh2.AutoDevInfo, &_DrawCh2, &ParamCh2);
	  GUI_RotatePolygon(ParamCh3.aPoints, _aNeedle, countof(_aNeedle), ParamCh3.Angle);
    GUI_MEMDEV_DrawAuto(&AutoDevCh3, &ParamCh3.AutoDevInfo, &_DrawCh3, &ParamCh3);
	  GUI_RotatePolygon(ParamCh4.aPoints, _aNeedle, countof(_aNeedle), ParamCh4.Angle);
    GUI_MEMDEV_DrawAuto(&AutoDevCh4, &ParamCh4.AutoDevInfo, &_DrawCh4, &ParamCh4);
		GUI_MEMDEV_DrawAuto(&AutoDevNumText, &ParamNumtext.AutoDevInfo, &_DrawText, &ParamNumtext);
		
   
    GUI_MEMDEV_DeleteAuto(&AutoDevCh1);
    GUI_MEMDEV_DeleteAuto(&AutoDevCh2);
    GUI_MEMDEV_DeleteAuto(&AutoDevCh3);
    GUI_MEMDEV_DeleteAuto(&AutoDevCh4);
		GUI_MEMDEV_DeleteAuto(&AutoDevNumText);
}

