  // Check if recommended memory for the sample is available
  //
  if (GUI_ALLOC_GetNumFreeBytes() < RECOMMENDED_MEMORY) {
    GUI_ErrorOut("Not enough memory available."); 
    return;
  }
  #if (!defined(WIN32))
  if ((LCD_GetMirrorYEx(0) == 1) && (LCD_GetSwapXYEx(0) == 1) && (LCD_GetVXSizeEx(0) > LCD_GetXSizeEx(0))){
    GUI_SetOrg(800, 0); // Temporarilly required, will be solved in future
  }
  #endif
  
  WM_EnableMemdev(WM_HBKWIN);
  WM_SetCallback(WM_HBKWIN, _cbWin);

  /*
  * Create title of sample
  */
  
  //TX title
  hText = TEXT_CreateEx(200, 0, 300, 80, WM_HBKWIN, WM_CF_SHOW, 0, GUI_ID_TEXT0, "TX");
  TEXT_SetFont(hText, &GUI_Font24B_ASCII);
